import React, { Component } from 'react';
import axios from 'axios';
import submitted from './submitted';
import { Redirect } from 'react-router-dom';

const check = false;
let data = '';
class Contact extends Component {
    constructor(props) {
        super(props);

        this.state = {
            username: '',
            email: '',
            query:'',
        };
    }


    handleInputChange = e => {
        this.setState({
            [e.target.name]: e.target.value,
        });
    };

    handleSubmit = e => {
        e.preventDefault();

        // console.log("happy")
        const { username , email, query} = this.state;


        const contactus = {
            username,
            email,
            query,
        };

        // console.log(account);



        axios.post('http://localhost:5000/contact', contactus )
            .then((res) => {

                console.log(res.status);
                this.setState({
                    redirect: true
                  })
            })

            .catch(err => {
                console.error(err.status);  
            },{
                withCredentials: true,
                headers: {'Access-Control-Allow-Origin': '*', 'Content-Type': 'application/json'
            }});

        this.setState({ username: '' , email: '' , query: ''})


        document.forms['myform'].reset();




    };



    renderRedirect = () => {
        if (this.state.redirect) {
          return <Redirect to='/submitted' />
        }
      }



    render() {
        return (
            <div>
                <br />
                <div className="container">

                        <div className="login-form">
                            <h1>Enter Your Query</h1>
                            <form id="myform" onSubmit={this.handleSubmit}>
                                <input type="text" name="username" placeholder="Username" required onChange={this.handleInputChange}/>
                                    <input type="text" name="email" placeholder="email" required onChange={this.handleInputChange}/>
                                    <input type="text" name="query" placeholder="query" required onChange={this.handleInputChange}/>
                                        <input type="submit"/>

                            </form>
                        </div>
                </div>
                <h1>{this.data}</h1>
            </div>
        );
    }
}

export default Contact;
